import React from 'react';
import PropTypes from 'prop-types';
import '../sass/svg-map.css';
import { getRanges } from '../utils';

const assigningDataToLocation = (locations, data) => {
	if (data && data.locations) {
		let dataLocations = data.locations;
		let dataLength = dataLocations.length;
		for (let i = 0; i < locations.length; i++) {
			for (let j = 0; j < dataLength; j++) {

				if (locations[i].name === dataLocations[j].name) {
					locations[i]["data"] = dataLocations[j].members;
					break;
				}
				if (j === dataLength - 1) {
					locations[i]["data"] = "NA";
				}
			}
		}
	}
	return locations;
}

const setStyleBasedOnWage = (wage, data) => {
	let arr = getRanges(data);
	for (let i = 0; i < arr.length - 1; i++) {
		if (wage >= arr[i].min && wage <= arr[i].max) {
			return `range${i + 1}`;
		}
		else if (wage === -1) {
			return 'location';
		}
	}
	return 'location';
}

